import React from 'react'
import { popularProducts } from '../data'

const Container = styled.div`
    padding: 1.2rem;
    display: flex;
    flex-wrap: wrap;
    justify-content: space-between;
`
const Products = () => {
  return (
    <Container>
        {popularProducts.map(item =>(
            <Product item={item} key={item.id}/>
        ))}
    </Container>
  )
}

export default Products
